import { Home } from './Home';
import { Router } from '@reach/router';


function App() {

  const data = [{
    NomeCampagna: 'Coap',
    Autore: 'hjk',
    profilo: 'hjk'
  }];


  return (

    <Router>
      <div style={{ background: 'red', height: 100, width: 100}}>
    <Home path="/" dataVar={data}></Home>
    </div>
    </Router>

  );
}

export default App;
